import React, { Component} from "react";
import { Animate } from "react-move";
import Image from "../assets/images/Images";

const Symbol =()=> {
  const symbols = {}

  const getImage = () => {
    switch (this.props.symbol) {
      case "A":
        return Image.America;
      case "G":
        return Image.Aragon;
      case "N":
        return Image.Argentina;
      case "S":
        return Image.Assen;
      case "U":
        return Image.Australia;
      case "C":
        return Image.Catalunya;
      case "F":
        return Image.Finland;
      case "R":
        return Image.France;
      case "Y":
        return Image.Germany;
      case "I":
        return Image.Indonesia;
      case "J":
        return Image.Japan;
      case "Z":
        return Image.Jerez;
      case "M":
        return Image.Malaysia;
      case "O":
        return Image.Misano;
      case "L":
        return Image.Mugello;
      case "T":
        return Image.Osterreich;
      case "P":
        return Image.Portugal;
      case "Q":
        return Image.Qatar;
      case "H":
        return Image.Thailand;
      case "K":
        return Image.UK;
      case "D":
        return Image.Fool;
      case "B":
        return Image.Valencia;
      default:
        return Image.Fool;
    }
  };



    return (
        <div className="reelSymbol">
          <p>Sugi pula</p>
        </div>
    );

}

export default Symbol;
